  [],\n\t\"num_tags\": 0,\n\t\"name\": \"rugosity-grid-derived-from-gridded-bathymetry-of-tau-island-of-the-manua-island-group-american-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Rugosity is derived from gridded (5 m cell
  size) multibeam bathymetry, collected aboard R/V AHI, and bathymetry derived from
  multispectral IKONOS satellite imagery using the Benthic Terrain Modeler with rugosity
  methods by Jeff Jenness (2003). Cell values reflect the (surface area) / (planimetric
  area) ratio for the area contained within that cell's boundaries. They provide indices
  of topographic roughness & convolutedness. This data set is for Ta'u Island of the
  Manu'a Island group, American Samoa.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
